query operation($limit: Int, $nextToken: String, $lastSync: AWSTimestamp, $syncExpression: ModelUserSyncExpressionInput) {
  syncUsers(limit: $limit, nextToken: $nextToken, lastSync: $lastSync) {
    items {
      id
      firstName
      lastName
      username
      jobTitle
      sortOrder
      _version
      _lastChangedAt
      _deleted
    }
    nextToken
    startedAt
  }
}
